import React, { StrictMode } from "react";
import ReactDOM from "react-dom";
import { Provider } from "react-redux";
import App from "./App";
import "./index.css";

ReactDOM.render(
  <StrictMode>
    <Home />
  </StrictMode>,
  document.getElementById("root")
);

function Home() {
  return (
    <Container>
      <Section />
    </Container>
  );
}

const Container = styled.div`
  height: 100vh;
`;
